        "milestones": {
            "primary": 9,
            "primaryText": "Prismatic Champion [120\u2605]\nEarn five Rainbow Gems in your stats page by achieving a total time of 17 minutes or less across all levels.\n\nPerfect Dismount [80\u2605]\nEarn the Rainbow Gem for Survival Mode by completing it without losing any lives. Quit to menu is disallowed.\n\nPogo King [40\u2605]\nEarn four Rainbow Gems in your stats page by achieving a total time of 18 minutes or less across all levels.\n\nStick the Landing [20\u2605]\nComplete Survival Mode. Quit to menu is disallowed.\n\nPogo Knight [20\u2605]\nEarn three Rainbow Gems in your stats page by achieving a total time of 19 minutes or less across all levels.\n\nPogo Peon [20\u2605]\nEarn two Rainbow Gems in your stats page by achieving a total time of 20 minutes or less across all levels.\n\nPogo Scamp [25\u2605]\nEarn a Rainbow Gem in your stats page by achieving a total time of 21 minutes or less across all levels.\n\nSpringing Forth [15\u2605]\nBeat the rainbow time on every level.\n\nPogo Star [10\u2605]\nBeat the 3 star time on every level.",
            "community": 3,
            "communityText": "Outshined\nBeat or tie ilikeshiny's time on every level.\n\nPogomaniacal\nAchieve a total time of less than 16 minutes across all levels. \n\nShinier\nBeat ilikeshiny's Survival Mode time.",
            "achievements": 40
        },
        "information": "The roadmap and time benchmarks for the game can be found here: [https://docs.google.com/spreadsheets/d/1MMbgCwD2VCGqO_HtMyEx4YjPHDmoSwxSA9SfFnHvKtM/edit?usp=sharing](https://docs.google.com/spreadsheets/d/1MMbgCwD2VCGqO_HtMyEx4YjPHDmoSwxSA9SfFnHvKtM/edit?usp=sharing)\n\nLook on the tab called \"Suggested Roadmap\" for details on the steps you should take at each skill interval."
